import React from "react";

interface Props {
	result: {
		id: string;
		category: string;
		title: string;
		src: string;
		content: string;
		tags: Array<string>;
	}
}

const DetailPresenter = ({ result }: Props): JSX.Element => {
	return <div>
		<span>{result.category}</span>
		<span>{result.title}</span>
		<span>{result.content}</span>
	</div>;
};

export default DetailPresenter;
